		"full_text": "'꿈인지 상상인지 모를 어떤 세계에서 그는 선(線)들을 본다.\n어렴풋한 선(線)들은 곧 그의 과거가 되고, 현재가 되었다가 \n그 모든 시점에서의 그의 얼굴이 되기도 한다.\n그가 사랑했던 선들이 더이상 형태를 이루지 못하고 흩어진 순간\n그의 모든 행운도 함께 사라졌다.'",
